import React, { useState, useEffect } from "react";
import axios from "axios";

const DeletePersonal = () => {
  const [personalData, setPersonalData] = useState([]);
  const [deleteId, setDeleteId] = useState("");
  const [error, setError] = useState(null);

  // Function to fetch personal data
  const fetchPersonalData = async () => {
    try {
      const response = await axios.get("/auth/personal1"); // Adjust the endpoint as needed
      setPersonalData(response.data.data);
    } catch (err) {
      setError(err.message);
    }
  };

  // Function to delete a personal data item
  const deletePersonalItem = async () => {
    try {
      await axios.delete(`/auth/personal1/${deleteId}`); // Adjust the endpoint as needed
      fetchPersonalData(); // Refresh the data after deletion
      setDeleteId(""); // Clear the input field after deletion
    } catch (err) {
      setError(err.message);
    }
  };

  useEffect(() => {
    fetchPersonalData();
  }, []); // Fetch data on component mount

  return (
    <div>
      <h2></h2>

      {/* {error && <p>Error: {error}</p>}
       */}
      <div>
        {/* <label htmlFor="deleteId">ID:</label> */}
        <input
          className="delete-input"
          type="text"
          id="deleteId"
          placeholder="Delete Data"
          value={deleteId}
          onChange={(e) => setDeleteId(e.target.value)}
        />
        <br />
        <button className="delete" onClick={deletePersonalItem}>
          Delete by ID
        </button>
      </div>

      <p>
        <h1 className="patched-data">Patched Data</h1>
      </p>
    </div>
  );
};

export default DeletePersonal;
